import React from 'react'
import './TeamCard.css'
import { FaStar } from "react-icons/fa";
const TeamCard = (props) => {
    return (
        <div className="media col-4">

<div className="media-body card ">
            <img src={props.image} alt="" className=' d-none d-md-block ' />

            
                <div className="media-heading text-end pt-0">{props.name}
                    <h2 className="custom-text-muted">{props.position}</h2>
                    <div className="rating text-start">
                        <FaStar /><FaStar /><FaStar /><FaStar /><FaStar />


                    </div></div>



            </div>
            <p> {props.description}</p>
        </div>

    )
}

export default TeamCard
